import React from 'react';
import './App.css';
import BasicTextFields from './InputBox'
import ButtonAppBar from "./appbar";
import Box from "@material-ui/core/Box";
import { makeStyles, createStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => createStyles({
  root: {
    color: "#ff1133",
      padding: 40,
  },
}));


function App() {
    const classes = useStyles();
    return (
        <div className="App">
            <div>
                <ButtonAppBar/>
            </div>
                <Box display="flex" classes={classes.root} flexWrap="wrap">
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                </Box>

        </div>
    );
}

export default App;
